import React, { useState } from 'react'

var urlOfLastUpload = ""
var assetUrl = ""

export function uploadedAsset (imageUrl) {
    console.log(imageUrl)
    if(!imageUrl === "") {
        urlOfLastUpload = imageUrl
    }    

    if(imageUrl === ""){
        assetUrl = urlOfLastUpload
    } else {
        assetUrl = imageUrl
    }

    return assetUrl
}
